import { Container } from "react-bootstrap";
import Dish from "./Dish";
import './Dish.css';

const Home = () => {
  return (
    <>
      <Container className="dish-container">
        <Dish />
        <Dish />
        <Dish />
        <Dish />
        <Dish />
      </Container>
    </>
  );
};

export default Home;
